function IsoMetricMobGenerator(world,name,settings) {
  var opts = settings || {};

  this.name = name;
  this.world = world;

  this.speed = opts.speed || 5;
  this.health = opts.health || 5;

  this.xCorrection = opts.xCorrection || 0;
  this.yCorrection = opts.yCorrection || 0;

  this.spriteSheet = {
    width: Math.round(500/9),
    height: Math.round(519/8),
    tick: 125,
    factor: opts.size || 2
  };

  // Les donn√©es du spriteSheet
  this.baseSpriteSheet = 'data:image/png;base64,';
  IsoMetricMobGenerator.List[this.name] = this;
}
IsoMetricMobGenerator.List = {};
